import React from 'react'
import InputField from './InputField';

const WeeklyUpdate = () => {
  const Overall = [{
    InputHead: "T&M/Fixed Cost"
  },
  {
    InputHead: "T&M/Fixed Cost"
  },
  {
    InputHead: "T&M/Fixed Cost"
  }]
  return (
    <div className='WeeklyUpdate'>

      <div className='WeeklyUpdate_Head'>
        <h1 className='WeeklyUpdate_Head_Title'>Weekly Update</h1>
      </div>
      <form>
        <div className='WeeklyUpdate_Overalldetail'>

          <h1 className='WeeklyUpdate_Overalldetail_Title'>Overall Detail</h1>
          <div className='WeeklyUpdate_Overalldetail_Field1'>
            <label className='WeeklyUpdate_Overalldetail_label1'>T&M/Fixed Cost</label><br />
            <input className="WeeklyUpdate_Overalldetail_input1" type="text" />
          </div>

          <div className='WeeklyUpdate_Overalldetail_Field2'>
            <label className='WeeklyUpdate_Overalldetail_label2'>T&M/Fixed Cost</label><br />
            <input className="WeeklyUpdate_Overalldetail_input2" type="text" />
          </div>

          <div className='WeeklyUpdate_Overalldetail_Field3'>
            <label className='WeeklyUpdate_Overalldetail_label3'>T&M/Fixed Cost</label><br />
            <input className="WeeklyUpdate_Overalldetail_input3" type="text" />
          </div>




        </div>

      </form>
    </div>
  )
}

export default WeeklyUpdate;
